import React from 'react';

const BackgroundRemover = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Right',
		alignItems: 'Right',
		height: '100vh'
	}}
	>
	<h1>BackgroundRemover.</h1>
	</div>
);
};

export default BackgroundRemover;
